import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Dropdown = () => {
  const [year, setYear] = useState('');
  const [course, setCourse] = useState('');
  const [batch, setBatch] = useState('');

  const handleYearChange = (event) => {
    setYear(event.target.value);
  };

  const handleCourseChange = (event) => {
    setCourse(event.target.value);
  };

  const handleBatchChange = (event) => {
    setBatch(event.target.value);
  };

  return (
    <div>
      <h3>Year: {year}</h3>
      <select value={year} onChange={handleYearChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Course: {course}</h3>
      <select value={course} onChange={handleCourseChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <h3>Batch: {batch}</h3>
      <select value={batch} onChange={handleBatchChange}>
        <option value="">Select an option</option>
        <option value="option1">Option 1</option>
        <option value="option2">Option 2</option>
        <option value="option3">Option 3</option>
      </select>
      <br />
        <button Link to="./MarksAddPage">Add</button>

    </div>
  );
};

const Table = () => {
  const [data, setData] = useState([
    { stuID: 1, subName: 'Math', subID: 'MATH101', marks: 90 },
    { stuID: 2, subName: 'Science', subID: 'SCI101', marks: 85 },
    { stuID: 3, subName: 'English', subID: 'ENG101', marks: 95 },
  ]);

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Stu ID</th>
            <th>Sub Name</th>
            <th>Sub ID</th>
            <th>Marks</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.stuID}</td>
              <td>{row.subName}</td>
              <td>{row.subID}</td>
              <td>{row.marks}</td>
              <td>
                <button>Edit</button>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const AppOne = () => {
  return (
    <div>
      <h1>Marks Add</h1>
      <Dropdown />
      <Table />
    </div>
  );
};

export default AppOne;
